              onClick={this.handleClickOpen}
            />
            <BottomNavigationAction
              label="제품 삭제"
              icon={<DeleteSharp />}
              onClick={this.handleClickOpen}
            />
          </BottomNavigation> */}
        </Paper>
        <TabPanel index={0}> 
            Item One
        </TabPanel>
        <TabPanel index={1}>
            Item Two
        </TabPanel>
        <TabPanel index={2}>
            Item Three
        </TabPanel>
      </Box>
    );
  }
}

class TabPanel extends Component {
  render() {
    return (
      <Typography component="div" hidden={this.props.value !== this.props.index}>
        <Box p={3}>{this.props.children}</Box>
      </Typography>
    );
  }
}

export default Item;
